                        <p>
                        \u041F\u0440\u043E\u0431\u043B\u0435\u043C\u043E\u0439 \u0433\u0435\u0442\u0435\u0440\u043E\u0441\u0442\u0440\u0443\u043A\u0442\u0443\u0440 \u0432 \u043D\u0430\u0441\u0442\u043E\u044F\u0449\u0435\u0435 \u0432\u0440\u0435\u043C\u044F \u043F\u0440\u043E\u0434\u043E\u043B\u0436\u0430\u044E\u0442 \u0437\u0430\u043D\u0438\u043C\u0430\u0442\u044C\u0441\u044F \u0443\u043D\u0438\u0432\u0435\u0440\u0441\u0438\u0442\u0435\u0442 \u0418\u0422\u041C\u041E,  (<a href="https://news.itmo.ru/ru/science/new_materials/news/6993/" target="_blank">\u0423\u0447\u0435\u043D\u044B\u0435 \u0423\u043D\u0438\u0432\u0435\u0440\u0441\u0438\u0442\u0435\u0442\u0430 \u0418\u0422\u041C\u041E \u0441\u0438\u0441\u0442\u0435\u043C\u0430\u0442\u0438\u0437\u0438\u0440\u043E\u0432\u0430\u043B\u0438 \u0432\u0430\u0440\u0438\u0430\u043D\u0442\u044B \u0441\u043E\u0437\u0434\u0430\u043D\u0438\u044F \u0434\u0432\u0443\u043C\u0435\u0440\u043D\u044B\u0445 \u0433\u0435\u0442\u0435\u0440\u043E\u0441\u0442\u0440\u0443\u043A\u0442\u0443\u0440, \u043F\u0435\u0440\u0441\u043F\u0435\u043A\u0442\u0438\u0432\u043D\u044B\u0445 \u0434\u043B\u044F \u043E\u043F\u0442\u043E\u044D\u043B\u0435\u043A\u0442\u0440\u043E\u043D\u0438\u043A\u0438 \u0438 \u0431\u0438\u043E\u043C\u0435\u0434\u0438\u0446\u0438\u043D\u044B</a>), \u0421\u0413\u0423 (<a href="http://pp.rscf.ru/news/rossiyskie-uchenye-smodelirovali-geterostruktury-s-uluchshennym-analogom-grafena/" target="_blank">\u0420\u043E\u0441\u0441\u0438\u0439\u0441\u043A\u0438\u0435 \u0443\u0447\u0435\u043D\u044B\u0435 \u0441\u043C\u043E\u0434\u0435\u043B\u0438\u0440\u043E\u0432\u0430\u043B\u0438 \u0433\u0435\u0442\u0435\u0440\u043E\u0441\u0442\u0440\u0443\u043A\u0442\u0443\u0440\u044B \u0441 \u0443\u043B\u0443\u0447\u0448\u0435\u043D\u043D\u044B\u043C \u0430\u043D\u0430\u043B\u043E\u0433\u043E\u043C \u0433\u0440\u0430\u0444\u0435\u043D\u0430</a>
                        ), \u0430 \u0442\u0430\u043A\u0436\u0435 \u0443\u0447\u0435\u043D\u044B\u0435 \u0438\u0437 \u0421\u0428\u0410, \u042F\u043F\u043E\u043D\u0438\u0438 \u0438 \u0424\u0440\u0430\u043D\u0446\u0438\u0438 (<a href="https://www.science.org/doi/10.1126/science.aat6981" target="_blank">Twistable electronics with dynamically rotatable heterostructures</a>) \u0438 \u043C\u043D\u043E\u0433\u0438\u0435 \u0434\u0440\u0443\u0433\u0438\u0435.
                        \u0420\u0430\u0437\u0440\u0430\u0431\u043E\u0442\u043A\u043E\u0439 \u043B\u0430\u0437\u0435\u0440\u043E\u0432 \u043D\u0430 \u043A\u0432\u0430\u043D\u0442\u043E\u0432\u044B\u0445 \u0442\u043E\u0447\u043A\u0430\u0445 \u0437\u0430\u043D\u0438\u043C\u0430\u044E\u0442\u0441\u044F \u043D\u0430\u043F\u0440\u0438\u043C\u0435\u0440 \u0443\u0447\u0435\u043D\u044B\u0435 \u0438\u0437 \u0428\u0432\u0435\u0439\u0446\u0430\u0440\u0438\u0438 (<a href="https://www.science.org/doi/10.1126/sciadv.17006881" target="_blank">A customizable class of colloidal-quantum-dot metallic lasers and amplifiers</a>).
                        \u041C\u043E\u0436\u043D\u043E \u0441\u043A\u0430\u0437\u0430\u0442\u044C, \u0447\u0442\u043E \u0441\u0444\u0435\u0440\u0430 \u0440\u0430\u0431\u043E\u0442\u044B \u0443\u0447\u0435\u043D\u043E\u0433\u043E \u043E\u0447\u0435\u043D\u044C \u0430\u043A\u0442\u0443\u0430\u043B\u044C\u043D\u044B \u0432 \u043D\u0430\u0441\u0442\u043E\u044F\u0449\u0435\u0435 \u0432\u0440\u0435\u043C\u044F
                        </p>
